DROP TABLE IF EXISTS `answer`;
CREATE TABLE `answer` (
  `id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `batch_no` varchar(50) NOT NULL DEFAULT '' COMMENT '问题批次号,默认test_001,平时练习题',
  `problem_id` bigint(10) NOT NULL COMMENT '问题Id',
  `student_code` varchar(20) NOT NULL COMMENT '学生编号',
  `levels` tinyint(10) NOT NULL COMMENT '问题级别',
  `descs` varchar(300) NOT NULL COMMENT '问题描述',
  `answer` varchar(100) NOT NULL COMMENT '问题答案',
  `score` bigint(10) NOT NULL COMMENT '分数',
  `current_score` bigint(10) NOT NULL COMMENT '学生当前分数',
  `yn` tinyint(10) NOT NULL DEFAULT '1' COMMENT '是否失效 1 有效 0 无效',
  `sysVersion` bigint(10) NOT NULL DEFAULT '1' COMMENT '版本号',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `create_user` varchar(30) NOT NULL DEFAULT '' COMMENT '创建人',
  `update_user` varchar(30) NOT NULL DEFAULT '' COMMENT '更新人',
  `doingAnswer` varchar(200) DEFAULT NULL COMMENT '未回答答案',
  `doneAnswer` varchar(200) DEFAULT NULL COMMENT '回答正确答案',
  `failAnswer` varchar(200) DEFAULT NULL COMMENT '回答失败答案',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=77 DEFAULT CHARSET=utf8;

